@Vanessa I appreciate the videos and concerns raised, but often logic of the conclusions is too weak.

Vast majority of managing positions within MS are useless, performing simple marketing/HR/compliance activities. They are needed but not critical and often can be automated. Majority of consulting positions have shallow practical technical knowledge and usually serve as routers to competent teams and experts. Microsoft does not care about these positions; it is easier to reduce total amount of salaries paid for these positions by just laying off a lot of people and hiring new ones. It has nothing to do with actual developers. And you are mentioning managing positions yourself. On the other hand, if you can get 15-20% productivity improvement, you definitely want to reduce workforce by 15-20%. You cannot deny improvement - it is there. As team lead, I often discuss technical challenges with my subordinates and if I would ask "have you checked with chatgpt" and person would tell me "I don't like it" or "I don't know how to use it" then I will be disappointed, that we are wasting time.

I totally agree that FUD marketing tactics is awful, and it is obvious to many experienced professionals.
